import { Component } from "react";
import "./Counter.css";

export default class Counter extends Component {
  constructor() {
    this.state = {
      counter: 0,
    };
  }

  render() {
    return (
      <div className="Counter">
        <button onClick={this.increment}>+1</button>
        <span className="count">0</span>
      </div>
    );
  }

  increment() {
    console.log("increment");
  }
}
